    search: new FormControl("", { nonNullable: true }),
  });

  @Output()
  search = new EventEmitter<string>();

  constructor() {}

  ngOnInit(): void {}

  onSubmit(value: string) {
    if (value !== "") {
      console.log(value);
      this.search.emit(value.toLowerCase());
    }
  }

  resetForm() {
    this.searchForm.reset();
  }
}

